import React from 'react';
import YoutubeEmbed from "../YoutubeEmbed";

const Videos = () => {
	return 
	<div>
		<div className="ui container">
			<div>
			<YoutubeEmbed embedId="h7F2-IguYfM" />
			</div>
			<div>
			<YoutubeEmbed embedId="kbTqmXsdRdg" />
			</div>
		</div>
	</div>;
};

export default Videos;
